Species* getSpecies(int* count)
{
    *count = sizeof(defs) / sizeof(defs[0]);
    return defs;
}
Species* getSpeciesByIndex(int index)
{
    assert(index >= 0 && index < (sizeof(defs) / sizeof(defs[0])));
    return &defs[index];
}
